import styled from 'styled-components';

export const TextProgress = styled.div`
  font-family: Verdana;
  color: white;
  text-transform: uppercase;
  font-size: 5em;
  background: rgb(255,255,255);
  background: linear-gradient(90deg, rgba(255,255,255,1) 58%, rgba(0,212,255,1) 100%);
`;
